import React from 'react';
import styles from './detail_section.module.css'
const DetailSection = (props) => {
    return (
        <div className={styles.detail_section}>
            <p className={styles.detail_section_p}> <strong>700만 명</strong>의 여행자</p>
            <p className={styles.detail_section_p}>  <strong>100만 개</strong>의 여행 리뷰</p>
            <p className={styles.detail_section_p}>  <strong>470만 개</strong>의 여행 일정</p>
        </div>);
}
export default DetailSection;
